import { Formik } from "formik";
import registerService from "../../services/registerService";
import "./register.css";

export default function Register() {
  return (
    <>
      <h2> formulario de registro </h2>
      <Formik
        initialValues={{ username: "", password: "" }}
        onSubmit={(values, {}) => {

         return  registerService(values)
        }}
      >
        {({ errors ,handleChange, handleSubmit, isSubmitting }) => (
          <form onSubmit={handleSubmit}>
            <input name={"username"} onChange={handleChange}></input>
            <input name={"password"} onChange={handleChange}></input>
            <button className="btn" disabled={isSubmitting}>Register</button>
          </form>
        )}
      </Formik>
    </>
  );
}
